import React, { FC } from 'react'

import ListOrder from '../components/Lists/ListOrders/ListOrder'
import { useDispatch } from 'react-redux'
import { orderRemove, quantityAdd, quantityLess } from '../store/orderSlice'
import FormUser from '../components/Forms/FormUser/FormUser'
import { nameChange } from '../store/userSlice'



const ShopCard: FC = () => {
   const dispatch = useDispatch()
  return (

    <div className='flex'>
     <FormUser  
     nameChange = {(event) => dispatch(nameChange(event.target.value))}
     emailChange= {(event) => dispatch((event.target.value))}
     phoneChange = {(event) => dispatch(nameChange(event.target.value))}
     addressChange = {(event) => dispatch(nameChange(event.target.value))}
     />
      <ListOrder 
         orderRemove={(event) => dispatch(orderRemove(event))}
         quantityAdd={(event) => dispatch(quantityAdd(event))}
         quantityLess={(event) => dispatch(quantityLess(event))} />
    </div>
  )
}

export default ShopCard
